pragma solidity ^0.5.0;
pragma experimental ABIEncoderV2;

import "../libs/IexecODBLibCore.sol";

import "../IexecStore.sol";

contract IexecCategoryManager // make interface
{
	event CreateCategory(
		uint256 catid,
		string  name,
		string  description,
		uint256 workClockTimeRef);

	function viewCategory  (uint256 _catid                                                             ) external view returns (IexecODBLibCore.Category memory);
	function countCategory (                                                                           ) external view returns (uint256);
	function createCategory(string calldata name, string calldata description, uint256 workClockTimeRef) external returns (uint256);
}

contract IexecCategoryManagerDelegate is IexecCategoryManager, IexecStore
{
	/**
	 * Accessors
	 */
	function viewCategory(uint256 _catid)
	external view returns (IexecODBLibCore.Category memory)
	{
		require(_catid < m_categories.length, "invalid catid");
		return m_categories[_catid];
	}

	function countCategory()
	external view returns (uint256)
	{
		return m_categories.length;
	}

	/**
	 * Methods
	 */
	function createCategory(
		string  calldata name,
		string  calldata description,
		uint256          workClockTimeRef)
	external onlyOwner returns (uint256)
	{
		uint256 catid = m_categories.push(IexecODBLibCore.Category(
			name,
			description,
			workClockTimeRef
		));
		emit CreateCategory(
			catid,
			name,
			description,
			workClockTimeRef
		);
		return catid;
	}

}
